###  Коммерческая недвижимость в Испании - цены ### 

Инвестиции в коммерческую недвижимость всегда отличались стабильной рентабельностью и приемлемой ценой. Наиболее часто частные инвесторы вкладывают суммы до 500 тысяч евро. Если покупатель планирует получить ВНЖ, то сумма вложений должна быть не менее 2 млн евро.

Как и рынке жилой недвижимости, цены на коммерческие варианты определяются рядом факторов, главными из которых являются:

* ее тип (кафе, гостиница, салон красоты и так далее);
* регион Испании и конкретное местоположение (проходимость места, удаленность от моря и так далее);
* текущее состояние самой недвижимости и бизнеса в целом;
* необходимость вложений и их тип - капитальные, операционные;
* рентабельность бизнеса (реальная и потенциальная);
* юридические факторы (есть ли залог, сколько владельцев и так далее).

**Средние цены на коммерческую недвижимость в Испании и готовые бизнесы выглядят примерно так:**

1. Небольшие кафе и бары на побережье или в туристических городах (кроме Барселоны и Мадрида) можно найти по ценам от 250-300 тысяч евро, полноценные рестораны - от 500 000 евро.
2. Маленькие помещения под бизнес, например, ремонт обуви ии одежды, фотоуслуги - от 50 000 евро (за площади до 20 квадратных метров).
3. Хостелы и апарт-отели на 5-6 номеров можно найти также по ценам от 500 000 евро (очень сильно зависит от их местораспложения и состояния).
4. Полноценные гостиницы и отели от 2-х звезд - от 900 000 евро, 3-4 звезды - ближе к 1 500 000 евро, верхний предел ничем не ограничен. В Барселоне и Мадриде стоимость приличных отелей начинается от 3 000 000 евро.
5. Cредняя стоимость квадратного метра офисной недвижимости стартует от 2-3 тысяч евро.
6. Автомобильные заправки с комплексом услуг (например автомойкой) будут стоить от 700 000 евро (на побережье Коста Бланка).

### Средние показатели рентабельности бизнеса в Испании ### 

Задумываясь о покупке бизнеса в Испании, следует помнить о средних показателях его рентабельности. Этот показатель для практически любого вида бизнеса в этой стране колеблется от 3% (крайний минимум) до 10% (только при условии очень хорошего управления) годовых, средние показатели - 5-7%. Это касается и сдачи жилья в аренду, и управления мини-отелем, автомойкой или заправкой, получением пассивного дохода от сдачи коммерческой недвижимости в аренду.

Как правило, жителям России и стран СНГ эти показатели кажутся очень низкими, но следует помнить о фундаментальных экономических причинах таких цифр:

* средняя ставки по ипотеке в Испании - 3%, по банковским депозитам - 0,7%;
* коэффициент инфляции - около 2,3% в годовом выражении (в России - в два раза выше);
* налоговая ставка - от 25% для физлиц, и примерно под 40% для бизнесов;
* высокий уровень конкуренции на всех рынках.	


Офисы и торговая недвижимость в Испании - неплохой вариант для покупки в Мадриде и Барселоне, в этих городах можно рассчитывать на хорошую рентабельность. Отели и жилье для сдачи в аренду стоит покупать на популярных туристических курортах, и это будут очень стабильные инвестиции в недвижимость. При этом самые дорогие регионы — Барселона, Мадрид, Коста-Брава и Коста-дель-Соль, а более дешевые — Коста-Бланка и Коста-Дорада.

Также существует интерес к торговым помещениям и апартаментам в жилых комплексах для сдачи в аренду. Россияне предпочитают приобретать готовый бизнес на побережье, нежели начинать свое дело с нуля, что вполне оправдано.

> Покупка недвижимости для ведения бизнеса в Испании, или уже готового работающего варианта, всегда длительный процесс. Необходимо оценить все факторы, уровень рентабельности и рисков, и сделать оптимальный выбор. Кроме покупки, также можно рассмотреть варианты аренды готовых бизнесов, такие предложения встречаются не редко. Если вы примерно знаете, какую сумму денег хотите вложить и что получить на выходе, обращайтесь к нам. Наши менеджеры по коммерческим объектам работают в разных регионах Испании с банками и адвокатурами, и всегда готовы предложить подборки интересных вариантов под запросы каждого из клиентов. В нашей базе есть все от отелей и хостелов, магазинов и заправок, до вариантов элитных комплексов с собственными винодельнями. Отправляйте заявки сегодня!
